import React from "react";
import "../../dogFace.less";

export default function Smile() {
    return <div className="smile">
        <svg viewBox="-2 -2 84 23" width="84" height="23">
            <path d="M0 0c3.76 9.279 9.69 18.98 26.712 19.238 17.022.258 10.72.258 28 0S75.959 9.182 79.987.161"
                  fill="none" strokeWidth="3" strokeLinecap="square" stroke-miterlimit="3"></path>
        </svg>
    </div>
}
